/**
 * External dependencies
 */
import React, { useContext } from 'react';
import { __ } from '@wordpress/i18n';

/**
 * Internal dependencies
 */
import UpeOptInBanner from '../upe-opt-in-banner';
import UpeToggleContext from '../upe-toggle/context';

const BannerImage = () => (
	<img
		alt=""
		width="1280"
		height="960"
		src="data:image/png;base64,"
	/>
);

export default () => {
	const { isUpeEnabled } = useContext( UpeToggleContext );

	if ( isUpeEnabled ) {
		return null;
	}

	return (
		<UpeOptInBanner
			title={ __(
				'Enable the new Stripe checkout experience',
				'woocommerce-gateway-stripe'
			) }
			description={ __(
				'Get early access to additional payment methods and an improved checkout experience, now available to some merchants.',
				'woocommerce-gateway-stripe'
			) }
			Image={ BannerImage }
			data-testid="opt-in-banner"
		/>
	);
};
